import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { getDATAS} from '../../actions/pipes';
import logo from '../../assets/images/dashboard/circle.svg'
import { NotificationContainer, NotificationManager } from 'react-notifications';
import APIservice from '../user-pages/APIservice';
import logo2 from "../../assets/images/dashboard/circle.svg"
import logo3 from "../../assets/images/dashboard/circle.svg"
const productService = new APIservice();
class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      projects: [],
      errors: {}
    };
  }
  handleForm = e => {
    e.preventDefault();
  };
  handleInput = e => {
    e.preventDefault();
  };
  componentDidMount() {
    let thisComponent = this;
    productService.getDATAS()
      .then(function (response) {
        thisComponent.setState({ projects: response.data });
      })
  }



  render () {

    return (
      <div>

        <div className="page-header">
          <h3 className="page-title">
            <span className="page-title-icon bg-gradient-primary text-white mr-2">
              <i className="mdi mdi-home"></i>
            </span> Dashboard </h3>
          <nav aria-label="breadcrumb">
            <ul className="breadcrumb">
              <li className="breadcrumb-data active" aria-current="page">
                <span></span>Overview <i className="mdi mdi-alert-circle-outline icon-sm text-primary align-middle"></i>
              </li>
            </ul>
          </nav>
        </div>
        <div className="row">
          <div className="col-md-4 stretch-card grid-margin">
            <div className="card bg-gradient-warning card-img-holder text-black">
              <div className="card-body">
                <img src={logo} className="card-img-absolute" alt="circle" />
                <h4  className="font-weight-normal mb-3">Link To Analysis <i className="mdi mdi-file-find mdi-36px float-right"></i></h4>
              </div>
            </div>
          </div>
          <div className="col-md-4 stretch-card grid-margin">
            <div className="card bg-gradient-warning card-img-holder text-black">
              <div className="card-body">
                <img src={logo2} className="card-img-absolute" alt="circle" />
               <h4  className="font-weight-normal mb-3">Link To Reports  <i className="mdi mdi-information mdi-36px float-right"></i></h4>
              </div>
            </div>
          </div>
          <div className="col-md-4 stretch-card grid-margin">
            <div className="card bg-gradient-warning card-img-holder text-black">
              <div className="card-body">
                <img src={logo3} className="card-img-absolute" alt="circle" />
                <h4 className="font-weight-normal mb-3">Link To Patient Portal <i className="mdi mdi-seat-individual-suite mdi-36px float-right"></i></h4>
              </div>
            </div>
          </div>
        </div>

        <div className="row">
          <div className="col-12 grid-margin">
          <NotificationContainer />
        <form onSubmit={this.handleForm}>
        <div className="card">
              <div className="card-body">
                <h4 className="card-title">Patient Details</h4>
                <div className="table-responsive">
                  <table className="table table-bordered  table-hover">
                    <thead>
                      <tr>
                        <th> Project Name</th>
                        <th>Cancer Type </th>
                        <th> Status </th>
                        <th> BioSample TumorFile 1 </th>
                        <th> BioSample TumorFile 2 </th>
                        <th> BioSample TumorFile 3</th>
                        <th> BioSample TumorFile 4 </th>
                        <th> Action</th>


                      </tr>
                    </thead>
                    <tbody>

                    {this.projects.map(data =>

                              <tr key={data.id}>
                                  <td>
                                    <img src='https://as2.ftcdn.net/v2/jpg/02/83/89/39/500_F_283893986_Z4bhxqocuMm69mlCMlKhZ3XJ4rA74CPT.jpg' className="mr-2" alt="face" />{data.projectName} </td>
                                  <td>{data.cancerType} </td>
                                  <td>
                                    <label className="badge badge-gradient-success">DONE</label>
                                  </td>
                                  <td>{data.biosampleTumorfile1}</td>
                                  <td>{data.biosampleTumorfile2} </td>
                                  <td>{data.biosampleTumorfile3 }</td>
                                  <td>{data.biosampleTumorfile4 }</td>
                                  {/* <td><Link  className="btn btn-primary"  to={"/product-edit/"+data.id}>Edit</Link>  <button className="btn btn-danger"  onClick={(e)=> this.handleDelete(data.id) }> Delete</button> </td> */}


                                  </tr>





                    )}

                    </tbody>
                  </table>
                </div>
              </div>
            </div>

        </form>

          </div>
        </div>


      </div> 
    );
  }
}



export default Dashboard
